import React, {Component} from "react";
class Index extends Component {
    render = () => {
        console.log(props)
        return (
            <div>Rates =Hey</div>
        )
    }
}

export async function getStaticProps () {
    const hey = "hey";
    return {
        props: {hey}
    }
}
export default Index;
